import React, { Component } from 'react';
import Link from 'react-router-dom';

export default class Page404 extends Component {
    render() {
        return (
            <div>
                <h1>Page Not Found</h1>
                <p>Sorry, there is nothing to see here.</p>
                <p><Link to="/">Back to Home</Link></p>
            </div>
        )
    }
}
